import datetime
import logging
from enum import Enum
from typing import List, Dict, Optional

# Enhanced logging setup
logging.basicConfig(
    level=logging.INFO,
    format='%(asctime)s - %(levelname)s - %(message)s',
    handlers=[
        logging.FileHandler('broker.log'),
        logging.StreamHandler()
    ]
)

class PublishStatus(Enum):
    DRAFT = "draft"
    PUBLISHED = "published"
    FAILED = "failed"

class SubmissionType(Enum):
    FABS = "fabs"
    DABS = "dabs"

class UserRole(Enum):
    ADMIN = "admin"
    AGENCY_USER = "agency_user"
    DEVELOPER = "developer"
    UI_DESIGNER = "ui_designer"
    DATA_USER = "data_user"
    BROKER_USER = "broker_user"
    TESTER = "tester"

class Submission:
    def __init__(self, submission_id: str, user_id: str, submission_type: SubmissionType):
        self.submission_id = submission_id
        self.user_id = user_id
        self.submission_type = submission_type
        self.publish_status = PublishStatus.DRAFT
        self.created_at = datetime.datetime.now()
        self.updated_at = datetime.datetime.now()
        self.errors = []
        self.warnings = []
        self.flexfields = {}

    def update_publish_status(self, new_status: PublishStatus):
        self.publish_status = new_status
        self.updated_at = datetime.datetime.now()
        logging.info(f"Submission {self.submission_id} status updated to {new_status}")

    def add_error(self, error_message: str):
        self.errors.append(error_message)
        logging.error(f"Error added to submission {self.submission_id}: {error_message}")

    def add_warning(self, warning_message: str):
        self.warnings.append(warning_message)
        logging.warning(f"Warning added to submission {self.submission_id}: {warning_message}")

class User:
    def __init__(self, user_id: str, name: str, role: UserRole, agency: Optional[str] = None):
        self.user_id = user_id
        self.name = name
        self.role = role
        self.agency = agency

class BrokerSystem:
    def __init__(self):
        self.submissions = {}
        self.users = {}
        self.cached_d_files = {}
        self.gtas_window = None

    def add_user(self, user: User):
        self.users[user.user_id] = user
        logging.info(f"User {user.name} added with role {user.role}")

    def create_submission(self, user_id: str, submission_type: SubmissionType) -> Optional[Submission]:
        if user_id not in self.users:
            logging.error(f"User {user_id} not found")
            return None

        submission_id = f"{submission_type.value}_{datetime.datetime.now().strftime('%Y%m%d%H%M%S')}"
        submission = Submission(submission_id, user_id, submission_type)
        self.submissions[submission_id] = submission
        logging.info(f"New {submission_type.value} submission created: {submission_id}")
        return submission

    def publish_submission(self, submission_id: str) -> bool:
        if submission_id not in self.submissions:
            logging.error(f"Submission {submission_id} not found")
            return False

        submission = self.submissions[submission_id]

        if submission.publish_status == PublishStatus.PUBLISHED:
            logging.warning(f"Submission {submission_id} already published")
            return False

        submission.update_publish_status(PublishStatus.PUBLISHED)

        # Simulate derivations and processing
        try:
            self._process_submission(submission)
            logging.info(f"Submission {submission_id} published successfully")
            return True
        except Exception as e:
            submission.update_publish_status(PublishStatus.FAILED)
            submission.add_error(str(e))
            logging.error(f"Failed to publish submission {submission_id}: {str(e)}")
            return False

    def _process_submission(self, submission: Submission):
        # Simulate processing logic
        if submission.submission_type == SubmissionType.FABS:
            self._derive_fabs_fields(submission)
        elif submission.submission_type == SubmissionType.DABS:
            self._validate_dabs_submission(submission)

    def _derive_fabs_fields(self, submission: Submission):
        # Simulate FABS field derivations
        submission.flexfields["FundingAgencyCode"] = "derived_code"
        submission.flexfields["PPoPCode"] = "00*****"
        logging.info(f"Derived FABS fields for submission {submission.submission_id}")

    def _validate_dabs_submission(self, submission: Submission):
        # Simulate DABS validation
        if not submission.flexfields.get("DUNS"):
            submission.add_error("DUNS number is required for DABS submissions")
            raise ValueError("DUNS validation failed")

    def cache_d_file(self, file_key: str, content: str):
        self.cached_d_files[file_key] = {
            "content": content,
            "timestamp": datetime.datetime.now()
        }
        logging.info(f"D File cached with key {file_key}")

    def get_cached_d_file(self, file_key: str) -> Optional[Dict]:
        return self.cached_d_files.get(file_key)

    def set_gtas_window(self, start: datetime.datetime, end: datetime.datetime):
        self.gtas_window = {"start": start, "end": end}
        logging.info(f"GTAS window set from {start} to {end}")

    def is_in_gtas_window(self) -> bool:
        if not self.gtas_window:
            return False
        now = datetime.datetime.now()
        return self.gtas_window["start"] <= now <= self.gtas_window["end"]

class UIDesignerTools:
    def __init__(self):
        self.testing_schedule = {}
        self.issues = []

    def schedule_user_testing(self, test_name: str, date: datetime.datetime, participants: List[str]):
        self.testing_schedule[test_name] = {
            "date": date,
            "participants": participants,
            "status": "scheduled"
        }
        logging.info(f"User testing '{test_name}' scheduled for {date} with {len(participants)} participants")

    def add_issue(self, issue: str, component: str, priority: str = "medium"):
        self.issues.append({
            "issue": issue,
            "component": component,
            "priority": priority,
            "status": "open",
            "created_at": datetime.datetime.now()
        })
        logging.info(f"New issue added for {component}: {issue}")

    def generate_testing_report(self, test_name: str) -> Optional[Dict]:
        if test_name not in self.testing_schedule:
            return None

        test = self.testing_schedule[test_name]
        report = {
            "test_name": test_name,
            "date": test["date"],
            "participants": test["participants"],
            "findings": [issue for issue in self.issues if issue["component"] == test_name],
            "status": test["status"]
        }
        logging.info(f"Generated testing report for '{test_name}'")
        return report

class HistoricalDataLoader:
    def __init__(self):
        self.loaded_data = []

    def load_fabs_data(self, data: List[Dict]):
        for record in data:
            # Simulate FABS data loading with derivations
            record["derived_fields"] = {
                "FundingAgencyCode": record.get("agency_code", "00*****"),
                "FREC": self._derive_frec(record)
            }
            self.loaded_data.append(record)
        logging.info(f"Loaded {len(data)} FABS records with derived fields")

    def load_fpds_data(self, data: List[Dict], include_historical: bool = True):
        for record in data:
            if include_historical or record["year"] >= 2007:
                self.loaded_data.append(record)
        logging.info(f"Loaded {len(data)} FPDS records (historical included: {include_historical})")

    def _derive_frec(self, record: Dict) -> str:
        # Simulate FREC derivation logic
        return f"FREC_{record.get('agency_code', '00000')}"

# Example usage
if __name__ == "__main__":
    system = BrokerSystem()
    ui_tools = UIDesignerTools()
    data_loader = HistoricalDataLoader()

    # Create users
    admin = User("user1", "Admin User", UserRole.ADMIN)
    agency_user = User("user2", "Agency User", UserRole.AGENCY_USER, "Department of Transportation")
    system.add_user(admin)
    system.add_user(agency_user)

    # Create and publish submission
    submission = system.create_submission("user2", SubmissionType.FABS)
    if submission:
        submission.flexfields = {"LegalEntityAddressLine3": "123 Main St"}
        system.publish_submission(submission.submission_id)

    # Schedule user testing
    ui_tools.schedule_user_testing("FABS Landing Page", datetime.datetime.now() + datetime.timedelta(days=7), ["tester1", "tester2"])
    ui_tools.add_issue("Button alignment off", "Resources Page")

    # Load historical data
    fabs_data = [{"id": 1, "agency_code": "DOT123"}, {"id": 2, "agency_code": "NASA01"}]
    data_loader.load_fabs_data(fabs_data)
